import React from 'react'
import Box from '@mui/material/Box';
import interactions from '../icons/interactions.png'
function StatisticCard(props) {
  return (
    <Box 
        height={161}
        width={262}
        bgcolor='grey'
        borderRadius='14px'
        sx={{
            boxShadow: '6px 6px 54px rgba(0, 0, 0, 0.05)'
        }}
        >
        <img src={interactions} alt="" />
    </Box>
  )
}
